'use strict';

var AppConfigPage = require('../../models/pages/AppConfigPage.js');

const gotoAppConfigPage = async ({ page, selectors, grafanaVersion, request }, use, testInfo) => {
  await use(async (args) => {
    const appConfigPage = new AppConfigPage.AppConfigPage({ page, selectors, grafanaVersion, request, testInfo }, args);
    await appConfigPage.goto();
    return appConfigPage;
  });
};

exports.gotoAppConfigPage = gotoAppConfigPage;
